  state={
    products: storeProducts
  };
  render() {
    console.log(this.state.products);
    return (
      <React.Fragment>
      <div className="py-5">
      <div className="container">
      <Title name="Gumbo's" title="Merchandise" />

      <div className="row">
      <ProductConsumer>
      {(hello) => {
        return <h1>{hello}</h1>;
      }}
      </ProductConsumer>
      </div>
      </div>
      </div>
       </React.Fragment>
      // <Product />
    );
  }
}
